import "./UserNotFound.css";

export default function UserNotFound() {
  return (
    <article className="e-one-user-not-found">
      <h3 className="e-one-user-not-found__header">Error 404</h3>
      <p className="e-one-user-not-found__message">User not found</p>
    </article>
  );
}
